import React from 'react';
import { Box, Card, Heading } from 'rebass'

const Post = ({ posts }) => {
  const post = posts.map((post, index) =>
      <Card key={post.id} className={"post__item"}>
      <Heading>
        {post.title}
        </Heading>
      </Card>
  );

  return (
    <Box className={"posts"}>
      {post}
    </Box>
  )
};

export default Post
